import React from "react";
import {
  SiteLogo,
  NavLinks,
  PhoneIcon,
  StyledNavbar
} from "./styles/Navbar.styled";
import { Btn, Flex, FlexItem } from "../../styles/general/General.styled";
import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <StyledNavbar>
      <Flex ai="center">
        <PhoneIcon />
        <FlexItem fg="1">
          <SiteLogo>OCA</SiteLogo>
        </FlexItem>
        <NavLinks to="/signup">
          <Btn>
            <Link>Features</Link>
          </Btn>
          <Btn>Get Chrome Extension</Btn>
          <Btn>Sign In</Btn>
        </NavLinks>
      </Flex>
    </StyledNavbar>
  );
};

export default Navbar;
